import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';

import { history } from '../history';
import PrivateRoute from './PrivateRoute';

import Login from '../pages/Login';
import Dashboard from '../pages/Dashboard';

import baseLogin from '../containers/login/login/index';
import RecuperarSenha from '../pages/RecuperarSenha/index'
import baseDashboard from '../containers/login/dashboard/BaseDasboard';

export default function Routes() {
    return (
        <BrowserRouter history={history}>
            <Switch>
                <Route path="/" exact component={baseLogin(Login)} />
                <Route path="/recuperar-senha"  component={baseLogin(RecuperarSenha)} />
                <PrivateRoute path="/dashboard" component={baseDashboard(Dashboard)} />
            </Switch>
        </BrowserRouter>
    );
}
